import React, {useEffect} from "react";
//thoughts: post=> Review first unapproved, admin page has unapproved request (add dorm request);
/// add dorm request contains review (dormname) + dormname+location+dormrating(default 0) if dormname not in review then he is adding a dorm
/// if 
import { useDispatch } from 'react-redux'
import { getSchools } from './actions/schools'


import {
  BrowserRouter,
  Routes,
  Route,

} from "react-router-dom";
import Home from "./pages/home/Home";
import AddDorm from "./pages/AddDorm/AddDorm"
import School from "./pages/School/School";
import Auth from "./components/Auth/Auth";

function App() {
  const dispatch = useDispatch();
  useEffect(() => {
    dispatch(getSchools());
    dispatch
  }, [dispatch]);

  return (
    <BrowserRouter>
      <Routes>
        <Route path="/" element={<Home />}/>
        <Route path="/auth" element={<Auth />}/>
        <Route path="/AddDorm/:id" element={<AddDorm />}/>
        <Route path="/dorms/:id" element={<School />}/>

      </Routes>
    </BrowserRouter>
  );
}

export default App;
